// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "./IPancakePair.sol";

interface IERC20{
    function balanceOf(address _owner) external view returns (uint256);
    function decimals() external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address from,address to,uint256 amount) external returns (bool);
}

interface IPancakeFactory {
    function getPair(address tokenA, address tokenB) external view returns (address pair);
}

contract NFB is ERC721,ERC721URIStorage{
    using SafeMath for uint256;
    address owner;
    uint8 public currBatchToBeMinted = 1;
    uint16 totalNFBSupply = 0;
    uint256 public _bondPrice;
    address CD3FiBUSDPairAddress;
    address CD3FiToken;
    IERC20 CD3FiContract;
    IPancakeFactory factory;
    uint256 epochOfDeployment;
    address sponsor;

    modifier onlyOwner{
        require (msg.sender == owner);
        _;
    }

    constructor(address _cd3fi, address _factory, address _cd3fiBUSDPair) ERC721("Non Fungible Bond","NFB"){
        owner=msg.sender;
        CD3FiToken = _cd3fi;
        CD3FiContract= IERC20(_cd3fi);
        factory = IPancakeFactory(_factory);
        CD3FiBUSDPairAddress = _cd3fiBUSDPair;
        epochOfDeployment = block.timestamp;
    }

    receive() external payable {}

    function transferAmount(address payable _to, uint256 amnt) public payable{
        (bool sent, bytes memory data) = _to.call{value: amnt}("");
        require (sent, "Failed to send amount");
    }

    function changePairAddress(address _pairAddress) public onlyOwner{
        CD3FiBUSDPairAddress = _pairAddress;
    }

    function mintNFB() public onlyOwner{
        require(totalNFBSupply <= 450, "All NFBs minted");
        for(uint8 i= 1; i<=50; i++){
            _mint(msg.sender, totalNFBSupply+i);
        }
        currBatchToBeMinted += 1;
        totalNFBSupply += 50;
    }

    function mintNFBForSponsor() public onlyOwner{
        for(uint8 i= 1; i<=50; i++){
            _mint(sponsor, totalNFBSupply+i);
        }
    }

    function _calcDiscount() private view returns(uint256){
        uint256 timePassed = block.timestamp.sub(epochOfDeployment);
        if(timePassed < 365 days) return 70;
        else if (timePassed < 730 days) return 60;
        else return 50;
    }

    function buyNFBWithoutCD3d(uint256 tokenId) public payable{
        require(msg.value >= _bondPrice,"Insufficient funds");
        _transfer(owner, msg.sender, tokenId);
        uint256 remainingBal = msg.value.sub(_bondPrice);
        transferAmount(payable(msg.sender), remainingBal);
    }

    function buyNFBWithCD3d(uint256 tokenId) public payable{
        uint256 discountedPrice = _bondPrice.sub((_bondPrice.mul(_calcDiscount()).div(100)));
        uint256 cd3FiRequired = getTokenPrice(CD3FiBUSDPairAddress, discountedPrice);
        CD3FiContract.approve(address(this),cd3FiRequired);
        CD3FiContract.transferFrom(address(this),address(0), cd3FiRequired);
        _transfer(owner,msg.sender,tokenId);
    }

    function _transfer(address from, address to, uint256 tokenId) internal override {
        if(tokenId >= 451){
            require(block.timestamp >= epochOfDeployment.add(1825 days),"Sponsor bond not matured");
        }
        require(balanceOf(to) < 5, "Can not buy more NFBs");
        if(from == owner){
             require(CD3FiContract.balanceOf(to) >= 1000, "Not enough CD3Fi on receiver");
        }
        else{
            require(CD3FiContract.balanceOf(from) >= 1000, "Not enough CD3Fi on sender");
            require(CD3FiContract.balanceOf(to) >= 1000, "Not enough CD3Fi on receiver");
        }
        super._transfer(from, to, tokenId);
    }

    function getTokenPrice(address pairAddress, uint amount) private view returns(uint){
        IPancakePair pair = IPancakePair(pairAddress);
        IERC20 token1 = IERC20(pair.token1());
        (uint Res0, uint Res1,) = pair.getReserves();
        uint res0 = Res0*(10**token1.decimals());
        return((amount*res0)/Res1); //return amount of CD3Fi needed to buy *amount* of USD
    }

    function _burn(uint256 tokenId) internal override(ERC721URIStorage, ERC721) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721URIStorage,ERC721)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }
}
